int hf_u16le(FILE* fp){
  int a = fgetc(fp);
  return a | (fgetc(fp)<<8);
}

int hf_cmap_lookup(FILE* fp, int cset, int code){
  fseek(fp,3,SEEK_SET);
  int ntbl = fgetc(fp);
  int dtbl = 0;
  if (cset){
    fseek(fp,4+(cset-1)*2,SEEK_SET);
    dtbl = hf_u16le(fp)*2;
  }
  fseek(fp,4+(cset)*2,SEEK_SET);
  int ltbl = hf_u16le(fp)*2-dtbl;
  int tbl = 4+ntbl*2+dtbl;
  fseek(fp,4+(ntbl-1)*2,SEEK_SET);
  int glyf = 4+ntbl*2+hf_u16le(fp)*2;
  while (1){
    fseek(fp,tbl,SEEK_SET);
    int idx0 = hf_u16le(fp);
    int idx1 = hf_u16le(fp);
    if (idx0 <= code && code <= idx1){
      fseek(fp,tbl+4+(code-idx0)*2,SEEK_SET);
      int ofs = hf_u16le(fp)*2;
      return glyf+ofs;
    }
    tbl += (idx1-idx0+1)*2 + 4;
    if (tbl >= 4+ntbl*2+dtbl+ltbl){
      break;
    }
  }
  return 0;
}

float hf_scale = 0.04;

float hf_advance(FILE* fp, int gid){
  if (gid <= 0){
    return 0;
  }
  fseek(fp,gid+1,SEEK_SET);
  return fgetc(fp)*hf_scale;
}

void hf_glyph(FILE* fp, int gid,
  void (*moveto)(float,float),
  void (*lineto)(float,float)
){
  if (gid <= 0) return;
  fseek(fp,gid,SEEK_SET);
  int npts = fgetc(fp);
  int w = fgetc(fp);
  int first = 1;
  for (int i = 0; i < npts; i++){
    int x = fgetc(fp);
    int y = fgetc(fp);
    if (x == ' ' && y == 'R'){
      first = 1;
      continue;
    }
    x -= 'R';
    y -= 'R';
    if (first){
      moveto(x*hf_scale,y*hf_scale);
    }else{
      lineto(x*hf_scale,y*hf_scale);
    }
    first = 0;
  }
}

